#include "library.h"

class Solution {
public:
    int m, n, num;
    vector<string> plate;
    vector<vector<vector<bool>>> viewed;
    vector<vector<vector<int>>> checked;
    vector<vector<int>> ans;

    vector<vector<int>> ballGame(int num, vector<string> &plate) {
        m = plate.size();
        n = plate[0].size();
        this->num=num;
        this->plate = plate;
        viewed = vector<vector<vector<bool>>>(m, vector<vector<bool>>(n, vector<bool>(4, false)));
        checked = vector<vector<vector<int>>>(m, vector<vector<int>>(n, vector<int>(4, -1)));
        --m;
        --n;
        ans.clear();
//        for (int i = 0; i <= m; ++i) {
//            for (int j = 0; j <= n; ++j) {
//                if (plate[i][j] == 'O') {
//                    dfs(i+1, j, 0, num);
//                    dfs(i, j-1, 1, num);
//                    dfs(i-1, j, 2, num);
//                    dfs(i, j+1, 3, num);
//                }
//            }
//        }
        int step = 0;
        for(int i = 1; i < m; ++i) {
            if (test(i, 0, 1)) ans.emplace_back(vector<int>{i,0});
            if (test(i, n, 3)) ans.emplace_back(vector<int>{i,n});
        }
        for(int j = 1; j < n; ++j) {
            if (test(0, j, 2)) ans.emplace_back(vector<int>{0,j});
            if (test(m, j, 0)) ans.emplace_back(vector<int>{m,j});
        }
        return ans;
    }
    bool test(int i, int j, int t) {
        if (plate[i][j] != '.') return false;
        int step=search(i, j, t);
        return step > 0 && step <= num;
    }
    int search(int i, int j, int t) {
        if (i < 0 || i > m || j < 0 || j > n) return -1;
        if (plate[i][j] == 'O') return 0;
        if (!viewed[i][j][t]) {
            viewed[i][j][t] = true;
            int _i = i, _j = j, _t = t;
            if (plate[i][j] == 'W') _t = (_t + 3) & 3;
            if (plate[i][j] == 'E') _t = (_t + 1) & 3;
            if (_t == 0) --_i;
            else if (_t == 1) ++_j;
            else if (_t == 2) ++_i;
            else --_j;
            int next = search(_i, _j, _t);
            if (next == -1) checked[i][j][t] = -1;
            else checked[i][j][t] = next + 1;
        }
        return checked[i][j][t];
    }

    void dfs(int i, int j, int t, int num) {
        if (--num < 0 || i < 0 || i > m || j < 0 || j > n || viewed[i][j][t] || plate[i][j] == 'O') return;
        viewed[i][j][t] = true;
        if ((i == 0 && j > 0 && j < n && plate[i][j] == '.' && t == 2) ||
            (i == m && j > 0 && j < n && plate[i][j] == '.' && t == 0) ||
            (j == 0 && i > 0 && i < m && plate[i][j] == '.' && t == 1) ||
            (j == n && i > 0 && i < m && plate[i][j] == '.' && t == 3))
            ans.emplace_back(vector<int>{i, j});
        if (plate[i][j] == 'W') t = (t + 1) & 3;
        if (plate[i][j] == 'E') t = (t + 3) & 3;
        if (t == 0) ++i;
        else if (t == 1) --j;
        else if (t == 2) --i;
        else ++j;
        dfs(i, j, t, num);
    }
};


